„Sūduva“ surinko 71 tašką ir A lygos lentelėje keturiais pranoko „Žalgirį“. Bronzą jau anksčiau buvo užsitikrinę „Trakai“ (64 tšk.). Paskutiniame ture Marijampolėje svečius iš sostinės būtų tenkinusi tik pergalė, bet pasvajoti apie ją Aleksandro Brazevičiaus komanda neturėjo nė mažiausios progos. Nuo pirmų minučių rudeninėje „Arvi“ stadiono aikštėje siautėjo šeimininkai, palaikomi rekordinio dydžio šiame sezone publikos – tribūnose mačą stebėjo per 4 tūkst. futbolo mėgėjų. Pirmas įvartis krito jau 7-ą minutę: Armanto Vitkausko ginamus vartus atrakino buvęs „Žalgirio“ gynėjas Semiras Kerla. Neprabėgus nė minutei rezultatą padvigubino Karolis Laukžemis. O paskutiniu lietimu pirmame kėlinyje vilniečius palaidojo kitas buvęs žalgirietis Andro Švrljuga. Po pertraukos titulą gynusio „Žalgirio“ bandymai gelbėtis nebuvo nei efektyvūs, nei gausūs: situaciją ant vejos visiškai kontroliavo kraujo skonį pajutę suvalkiečiai. Dėl grubesnių pražangų aikštėje keliskart buvo įsiplieskusios aistros, bet kumščių į darbą žaidėjai nepaleido. Tiesa, pačioje pabaigoje iš aikštės buvo išvarytas žalgirietis Diego Oyarzunas. Beje, dalis „Žalgirio“ aistruolių ankstyvos savo numylėtinių agonijos rungtynių pradžioje net nespėjo pamatyti, nes juos užlaikė ties Marijampolės riba dislokuotos gausios policijos pajėgos, stabdžiusios ir tikrinusios iš Vilniaus važiavusius autobusiukus su svečių fanais. Tokių saugumo priemonių imtasi po spalio pabaigoje „Arvi“ arenoje „Žalgirio“ gerbėjų sukeltų riaušių. (function(d, s, i, r) {
